import Nav from 'react-bootstrap/Navbar';
import img from '../Images/navlogo.jpg';
import { Container, Offcanvas } from 'react-bootstrap';
function Navbar(){
   const param = true;
    return(
        <>
            <Nav  className="bg-body-tertiary mb-3">
                <Container fluid>
                    <Nav.Brand><img src={img} alt='alt'/></Nav.Brand>
                    <Nav.Toggle aria-controls="offcanvasNavbar" />
                    <Nav.Offcanvas id="offcanvasNavbar" aria-labelledby="offcanvasNavbarLabel" placement="end">
                        <Offcanvas.Header closeButton>
                            <Offcanvas.Title id="offcanvasNavbarLabel">
                                Offcanvas
                            </Offcanvas.Title>
                        </Offcanvas.Header>
                        <Offcanvas.Body>
                            <Nav className="justify-content-end flex-grow-1 pe-3">
                            <Nav.Link href="#action1">Home</Nav.Link>
                            <Nav.Link href="#action2">About</Nav.Link>
                            </Nav>
                        </Offcanvas.Body>
                    </Nav.Offcanvas>
                </Container>
            </Nav>
        </>
    )
}

export default Navbar;
